$(document).ready(function () {
  $("picture>source").each(function () {
    var source = $(this).attr("src");
    // get img terdekat
    // jika ukuran media user bukan mobile
    if ($(window).width() > 400) {
      // buat element img setelah ini
      $(this).after("<img class='img-desktop' src='" + source + "' />");
    }
  });
  // replace src="https://www.indonesia.travel/ ke src="https://v1.indonesia.travel/
  $("img").each(function () {
    var src = $(this).attr("src");
    if (src) {
      src = src.replace(
        "https://www.indonesia.travel/",
        "https://v1.indonesia.travel/"
      );
      $(this).attr("src", src);
    }
  });
});
